import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/main_page.css';

const MainPage = () => {
    const navigate = useNavigate();

    const movies = [
        { id: 1, title: "Movie 1", poster: "url_to_movie1_poster.jpg" },
        { id: 2, title: "Movie 2", poster: "url_to_movie2_poster.jpg" },
        { id: 3, title: "Movie 3", poster: "url_to_movie3_poster.jpg" },
        { id: 4, title: "Movie 4", poster: "url_to_movie4_poster.jpg" },
    ];

    const handleMovieClick = (movieId) => {
        navigate('/form');
    };

    return (
        <div className="main-content">
            <h1>Select a Movie</h1>
            <div className="movie-catalog">
                {movies.map(movie => (
                    <div 
                        key={movie.id} 
                        className="movie-item"
                        onClick={() => handleMovieClick(movie.id)}
                        style={{ backgroundImage: `url(${movie.poster})` }} // Set the background image
                    >
                        <div className="movie-title">{movie.title}</div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default MainPage;
